import React from 'react';
import CardPic from '../components/Design/CardPic'
import { Container } from 'react-bootstrap'
import Curveball from '../assets/images/Personal/Curveball.JPG'

const Portfolio = () => {

    return(
    <Container>

        <h1>Portfolio Page</h1>
         <CardPic 
         image={Curveball}
         title="TESTING"
         body="testing body"
         />

    </Container>  
    )
}

export default Portfolio;
